import React, { useState, useEffect } from 'react';
import { getUserStats, toggleUserStatus } from '../services/userService';
import { getStageStats } from '../services/stageService';

const AdminDashboard = () => {
    const [users, setUsers] = useState([]);
    const [stageStats, setStageStats] = useState({});
    const [loading, setLoading] = useState(true);
    const [error, setError] = useState(null);

    useEffect(() => {
        fetchData();
    }, []);

    const fetchData = async () => {
        try {
            setLoading(true);
            const [usersData, stagesData] = await Promise.all([
                getUserStats(),
                getStageStats()
            ]);
            setUsers(usersData);
            setStageStats(stagesData);
        } catch (err) {
            setError('Erreur lors du chargement des données');
            console.error(err);
        } finally {
            setLoading(false);
        }
    };

    const handleToggleStatus = async (userId) => {
        try {
            await toggleUserStatus(userId);
            fetchData(); // Refresh data
        } catch (err) {
            setError('Erreur lors de la modification du statut');
        }
    };

    if (loading) return <div>Chargement...</div>;
    if (error) return <div className="error-message">{error}</div>;

    return (
        <div className="admin-dashboard">
            <h1>Espace Administration</h1>

            <section className="user-management">
                <h2>Gestion des comptes utilisateurs</h2>
                <div className="users-table">
                    <table>
                        <thead>
                            <tr>
                                <th>Nom</th>
                                <th>Prénom</th>
                                <th>Email</th>
                                <th>Rôle</th>
                                <th>Statut</th>
                                <th>Actions</th>
                            </tr>
                        </thead>
                        <tbody>
                            {users.map(user => (
                                <tr key={user.id}>
                                    <td>{user.nom}</td>
                                    <td>{user.prenom}</td>
                                    <td>{user.email}</td>
                                    <td>{user.role}</td>
                                    <td>{user.actif ? 'Actif' : 'Inactif'}</td>
                                    <td>
                                        <button
                                            onClick={() => handleToggleStatus(user.id)}
                                            className={`btn ${user.actif ? 'btn-danger' : 'btn-success'}`}
                                        >
                                            {user.actif ? 'Désactiver' : 'Activer'}
                                        </button>
                                    </td>
                                </tr>
                            ))}
                        </tbody>
                    </table>
                </div>
            </section>

            <section className="stage-stats">
                <h2>Statistiques des stages</h2>
                <div className="stats-cards">
                    <div className="stat-card">
                        <h3>En cours</h3>
                        <p>{stageStats.enCours || 0}</p>
                    </div>
                    <div className="stat-card">
                        <h3>Disponibles</h3>
                        <p>{stageStats.disponible || 0}</p>
                    </div>
                    <div className="stat-card">
                        <h3>Terminés</h3>
                        <p>{stageStats.termine || 0}</p>
                    </div>
                </div>
            </section>
        </div>
    );
};

export default AdminDashboard;
